def sumOfPrimes(start: int, end: int) -> int:

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    prime_sum = 1
    for num in range(start, end + 1):
        if is_prime(num):
            prime_sum += num
    return prime_sum

